    "# BELLABEAT DATA ANALYSIS CASE STUDY\n",
    "\n",
    "# Introduction\n",
    "\n",
    "This is a case study included in the Google Data Analytics Profiessional Certificate hosted by Coursera. This Capstone project is optional to the completion of the certificate program, but I am excited to apply the skills I've learned to the case study.\n",
    "\n",
    "The six phase analysis process (ask, prepare, process, analyze, share, & act) will help guide me in my analysis of Bellabeat's data and business question.\n",
    "\n",
    "Bellabeat is a high-tech manufacturer of health-focused products for women. They are a successful small company, but they have the potential to become a larger player in the global smart device market. Urška Sršen, cofounder and Chief Creative Officer of Bellabeat, believes that analyzing smart device fitness data could help unlock new growth opportunities for the company. \n",
    "\n",
    "The task is to focus on one of Bellabeat’s products and analyze smart device data to gain insight into how consumers are using their smart devices. The insights will then help guide marketing strategy for the company. Finally, present the analysis to the Bellabeat executive team along with high-level recommendations for Bellabeat’s marketing strategy.\n",
    "\n",
    "\n",
    "# Ask Phase\n",
    "\n",
    "**Identify The Business Problem/Task**\n",
    "1. Analyzing smart device fitness data to gain insight into how many consumers use their smart devices and to identify fitness and wellness trends.\n",
    "1. Recommend to stakeholders how to use these trends for targeted advertising to unlock new growth opportunities.\n",
    "\n",
    "Guiding questions\n",
    "\n",
    "1. The topics I am exploring are the women’s wellness market through fitness tracker data from Bellabeat.\n",
    "1. The metrics to be used are from the smart device fitness trackers, specifically FitBit trackers. \n",
    "1. The stakeholders are: \n",
    "    * **Urska Srsen**: Bellabeat’s cofounder and Chief Creative Officer\n",
    "    * **Sando Mur**: Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team\n",
    "    * Bellabeat **Marketing Analytics** Team\n",
    "1. The audience for this analysis will be top executives at Bellabeat and the marketing team. I will need to adjust my presentation to fit their needs, which may need to be short, to the point, and concise backed up by clear data.\n",
    "1. This data will help stakeholders by showing them how data trends may help the marketing team grow in certain areas.\n",
    "1. The insights from the data analysis of Bellabeat’s fitness tracker data can show trends in their products and how the marketing team can use these trends for targeted advertising for new growth opportunities.\n",
    "\n",
    "\n",
    "# Prepare Phase\n",
    "\n",
    "**Data Integrity**\n",
    "1. The data is organized into 18 different csv files. Each file contains data on different types of fitness metrics such as daily steps, intensity minutes, heart rate, calories, sleep minutes, etc. It is in long format.\n",
    "1. There are certain issues with bias and credibility of the data. Using the ROCCC method, these are my findings:\n",
    "    * The data may <ins>not be</ins> **reliable**, as there is no information on the subjects and how the survey was conducted by the original source of data. It also has a small sample base, so it has a **sample selection bias** because it doesn’t reflect the overall population.\n",
    "    * The **original** data source is from a survey conducted by Amazon Mechanical Turk.\n",
    "    * The data <ins>is not</ins> **comprehensive**, as it’s missing important information such as data on demographics. The sample size is fairly small for this type of data. It may not be representative of all types of Bellabeat’s consumers.\n",
    "    * The data is <ins>fairly</ins> **current and relative**, as it is only a few years old. However, from the time the data was collected, there have been improvements in data tracking abilities from fitness trackers and other important health and wellness metrics to track and record. <ins>This could make the data outdated and not current or relative.</ins>\n",
    "    * The recorded data <ins>is</ins> **cited** as it comes from Amazon Mechanical Turk, but we have no information on if this source is credible.\n",
    "1. This dataset is publicly accepted to be used as it is in the public domain and is easily accessible.\n",
    "1.  I verified the data’s integrity by analyzing the metadata, researching its source and reviewing the data itself. However, the data’s integrity is called into question. There are a couple areas of concern regarding the data’s integrity, such as the trustworthiness of its source, completeness, and potentially being outdated. It also does not provide demographics of the participants, therefore, we cannot verify if the participants were young or old, male or female, which is an issue since Bellabeat is a women's focused health and wellness brand.\n",
    "1. The data partially helps me answer our business question by providing data that can give us insights on fitness trends.\n",
    "1. Problems with the data are few. Potentially being outdated, reliability, trustworthiness, and its lack of comprehensiveness.\n",
    "    \n",
    "The **data integrity** of this dataset is in question, and therefore, cannot be a reliable source when making major business decisions by Bellabeat. It will need to be followed up by an analysis of a more reliable data source, preferably data recorded by the company itself. We can ascertain few insights from the data that we do have, but these findings should not be considered reliable for business-making decisions.\n",
    "\n",
    "\n",
    "# Process Phase\n",
    "\n",
    "I will use RStudio cloud for my analysis of this data. Rstudio will allow me to prepare, process, analyze, visualize, and even share the data all in one system. It can handle large dataframes without causing lag, and has a robust set of tools for the data analysis process. In addition, I can access all data and analyses anywhere I am via the cloud.\n",
    "\n",
    "I am using three spreadsheets in my analysis process. These spreadsheets are the most adequate and reliable sources for this business task.\n",
    "\n",
    "\n",
    "### Prepping my script for the analysis process\n",
    "\n",
    "I will start by loading packages to begin organizing, preparing and processing the data for analysis."
   ]
